package Protocole.test;

import Protocole.HTTP;

public class TestHTTP {
    public static void main(String[] args) {
        String s="";
        String h = "";
        for(int i=0;i<h.length();i+=2){
            s+= h.substring(i, i+2)+" ";
        }
        s.subSequence(0, s.length()-1);
        HTTP http = new HTTP(s);
        System.out.println(http);
    }
}
